import {useState,useEffect} from 'react'
import {showP} from '../api/api'
const Productlist = () => {
    const [product,setProduct] = useState([])

    const show = async() =>{
        try{
            const res =  await showP()
            setProduct(res.data)
            console.log(product)
        }catch(error){
            console.log(error)
        }
    }

    useEffect(()=>{
        show()
    },[])
  return (
    <div className=''>
        <h1>ProductList</h1>
    </div>
  )
}

export default Productlist
